/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {
    const map = new Map();

    // Подсчёт частоты символов в строке `s`
    for (const char of s) {
        map.set(char, (map.get(char) || 0) + 1);
    }

    // Проверка символов из строки `t`
    for (const char of t) {
        if (!map.has(char) || map.get(char) === 0) {
            // Если символ не найден в `Map` или его частота равна 0 — это добавленный символ
            return char;
        }
        // Уменьшаем частоту символа
        map.set(char, map.get(char) - 1);
    }
};


console.log(findTheDifference("abcd", "abcde")) // "e"
console.log(findTheDifference("e", "y")) // "y"
console.log(findTheDifference("a", "aa")) // "y"
console.log(findTheDifference(
    "", 
    ""
)) // "t"